disposition_text:
Admite cererea înregistrată sub nr. 962 din data de 09.01.2024  având ca obiect: sedii 
secundare, potrivit datelor din:  
Contract de locaţiune nr. 2136.CL din 11.12.2023; Contract de locaţiune nr. 2058.CL din 11.12.2023; 
Contract de locaţiune nr. 1956.CL din 11.12.2023; Contract de locaţiune nr. 1948.CL din 11.12.2023; 
Contract de locaţiune nr. 1285.CL din 11.12.2023; Contract de locaţiune nr. 1102.CL din 11.12.2023; 
Contract de locaţiune nr. 720.CL din 11.12.2023; Contract de locaţiune nr. 599.CL din 11.12.2023; 
Contract de locaţiune nr. 403.CL din 11.12.2023; Contract de locaţiune nr. 198.CL din 11.12.2023 . 
Dispune publicarea prezentei încheieri în Buletinul Electronic al Registrului Comerţului.  

Executorie. 

Cu drept de plângere, în termen de 10 zile, la Tribunalul Specializat Argeș în condițiile art.112 
și art.113 din Legea nr. 265/2022 privind registrul comerțului și pentru modificarea și completarea 
altor acte normative cu incidență asupra înregistrării în registrul comerțului. 

Pronunțată în data de: 10.01.2024

